import './about.css'
import aboutImage from '../../assets/images/maliweb.jpg'

const About = () => {
    return(
        <div className='about__container'>
            <div className='about__content'>
            <img className='about__image' src={aboutImage} alt="" />
            </div>
        </div>
    )
}
export default About
